import './App.css';
import {
  // import browser router as router 
  BrowserRouter as Router,
  // this will contain all routes
  Routes,
  // this will access a route
  Route
  } from 'react-router-dom'
import Eat from './Eat';
import Drink from './Drink';
import Home from './Home';

function App() {
  return (
    <Router>
      <div className='App'>
      <Routes>
        <Route
            exact
            path="/"
            element={<Home />}
        ></Route>
        <Route
            exact
            path="/eat"
            element={<Eat />}
        ></Route>
        <Route
            exact
            path="/drink"
            element={<Drink />}
        ></Route>
      </Routes>
      </div>
    </Router>
  );
}

export default App;
